INSERT INTO `mkd_email_crud` (`id`, `subject`, `tag`, `body`, `slug`) VALUES
(1,	'Proceed to next round',	'email,round_number,link,name',	'Congratulations {{{name}}}, you are moving on to the next round.\r\n\r\nPlease click <a href=\"{{{link}}}\">here</a> to continue to the voting phase of the next round and good luck! \r\nRemember failing to complete the voting process before 11:59 PM will result in elimination.  \r\n',	'next-round'),
(2,	'Eliminated from the tournament',	'email,round_number,link',	'Hi {{{email}}},<br/>You have been eliminated from the game tournament.',	'eliminated'),
(3,	'Congratulations',	'email,link,position',	'Hi {{{email}}},<br/>Congratulations! You placed {{{position}}} in our game tournament.<br/>Click the below link to see the winner list and your standings.<br/><a target=\"__blank\" href=\"{{{link}}}\">Link</a>',	'congratulation-message'),
(4,	'Sorry',	'email,link',	'Hi {{{email}}},<br/>Sorry it looks like you didn\'t win the competition .<br/>Click the below link to see the winner list.<br/><a href=\"{{{link}}}\">Link</a>',	'sorry-message'),
(5,	'Congratulations',	'name',	'Congratulations {{{name}}},\r\n\r\nThanks to your vote you have won the random draw. Someone from Universe.Art will email you requesting more information',	'drawwinner-message'),
(6,	'Voting for the final Round',	'email,round_number,link',	' Hi {{{email}}},<br/>\r\n <div style=\"text-align: center;\">\r\n <h1>You are eligible to vote for the final round!</h1>\r\n <a href=\"{{{link}}}\" class=\"button-two\" style=\"text-align: center;\r\n cursor: pointer;\r\n font-size: 24px;\r\n border-radius: 4px;\r\n background-color: #1e7e34;\r\n color: white;\r\n border: none;\r\n padding: 6px;\r\n width: 145px;text-decoration: none;\"><span>Final Round</span></a>\r\n </div>',	'final-round-voting'),
(7,	'Congratulations',	'name',	'Congratulations {{{name}}} on winning the tournament. You shone the brightest today! You are a very talented artist and we look forward to seeing more from you in the future.\r\n\r\nIf you have won a prize, someone from Universe.Art will email you requesting more information.\r\n\r\nCongratulations again and we will see you at the next one!',	'winner-first-position'),
(8,	'Congratulations',	'name,position',	'Congratulations {{{name}}} on placing {{{position}}} in the tournament. You were among the stars today\r\n\r\nYou are a very talented artist and we look forward to seeing more from you in the future.\r\n\r\nIf this position qualifies for a prize someone from Universe.Art will email you requesting more information.\r\n\r\nCongratulations again and we will see you at the next one!',	'winner-runners-up'),
(9,	'Proceed to final round',	'name',	'Congratulations, {{{name}}} you have risen to the top. Your expression has struck a chord amongst your peers. This is the final stage of the tournament. It may be hard to vote for another work at this point but please continue to vote honestly.\r\n\r\nGood luck and we will see you at the finish line.',	'final-round');
