(1008,	1,	1,	6,	NULL,	'',	'',	'Caleb',	'moon',	'I wonder\n\nI wonder where they go, those precious precious souls\n\nWhen life at last is lost\nUpon our precious shores\n\nWhen old and young and lively\nDescend  down deathly drawers \n\nI wonder if theres nothing or life evermore\n\nI wonder what of love and promises to keep\n\nIf really theres a God who separates the sheep\n\nI wonder if were weighed upon the weary scale\n\nIf balance being unblameable\nwill someday actually fail\n\nI wonder if its true\nThose precious precious few\n\nWho carry with them precious \npieces as they say adieu \n\nPrecious little parts of peoples precious hearts\n\nI wonder if it eases into enigmatic art\n\nI wonder were they go\nThose precious precious souls\n\nI hope they go to heaven with glory gained and gold\n\nI hope that life continues \nBeings begging to behold\n\nI wonder if theres fullness\nFor young and very old\n\nI wonder all these things\nAll these things that Ive been told\n\nI ponder all these things\nI wonder, with wondrous woes \n\nI wonder where they go\nThose precious precious souls\n',	'',	'public'),
(1009,	889,	3,	6,	NULL,	'image',	'https://venngage-wordpress.s3.amazonaws.com/uploads/2018/09/Colorful-Geometric-Simple-Background-Image.jpg',	'bob placid',	'suffer',	'Suffer with me\n\nSuffer with me please\nLet me carry your tears\nLet your burden fall heavy\nExpress to me your fears\n\nSuffer with me child\nLet me hold your weary head\nTell of desires wild\nFreedoms beyond the dead\n\nSuffer with me wretch\nFor wretched are we few\nPainful hearts we clench\nWe view suffering anew\n\nAnd suffer with me dear\nFor all I say and want\nIs to suffer with you near\nGrow beyond all dark thoughts\n\nSuffer with me saint\nDont view the pain as evil\nFor suffering was ordained\nIn heavens elusive steeple\n\nSuffer with me learned\nFor suffering teaches man\nThat lifes a bitch to hurt us\nShe takes us by the hand\n\nTo suffer with all mankind\nA blessed thing indeed\nSuffering produces joy in time\nSo suffering is a need.\n',	'',	'public'),
(1010,	890,	4,	6,	NULL,	'color',	'#000000',	'nullus',	'as we live',	'\nAs we live it changes who we are\nWhat we once were, suddenly we are more\nPain and strife and pressure the ore of our creation\nLiving, lights the forge of routine transformation\nGentle at inception, life begins its course\nSmooth and kind and bright impressionable, the warmth\nOh vanity would say we have been created like this\nFor what of the refinement of the master chisels chips\nIsnt life itself the venue of our being\nFor all that God damn pain, its only the beginning \nI was born pure as gold smooth and embraced\nBut birth is not the end for adaptation takes its place\nBeautiful the torture of the fire and the heat\nFor as we live today, tomorrow will have us beat\nAnd beautiful the scars that thicken our hide\nBeautiful the day when great fear was realized\nBeautiful the life we live which truly tries\nFor creation is more perfect as we live these trying times\n',	'',	'public'),
(1011,	891,	5,	6,	NULL,	'color',	'#DAA520',	'nullus',	'control for fear',	'We promised them gold and glory\nBut we hid it behind a caveat\nWe knew that those less savvy \nWould stay to give all of it\n\nAll their time, all their thoughts\nAll their mind, all their wants\nAll their money, all their wealth\nAll their freedoms, and all their health\n\nTell them freedom comes to those who obey\nGive the Rhetoric to pacify the day\n\nFeed the masses with slight of hand\nHerald the deceit as the promised land\n\nTake the child train him young\nAll his thinking well take from him\nStifle the joy, clone the boy\nIf we have free thinkers theyll see through our ploys\n\nGod is love, and love is God\nPeaceful, benevolent father above\nAncient scriptures when read correct, shows the creator cares and your freedoms He respects\n\nBut the fucking priests and pastors and fools\nHave delighted their pockets by coming up with new rules\n\nThey know that to control they must conceal simple truths\nThat God is love and he happens to love you.\n\nBut if He loves then whats to fear\nAnd if no fear then no appeal to obey\n\nAnd if they dont obey then whom will we control, \nWho will build us up upon our garish pedestals\n\nWe must enforce our laws and say that hell is nigh\nFor if they knew the truth \nNo one would ever comply',	'',	'public'),
(1012,	892,	6,	6,	NULL,	'color',	'#778899',	'onym',	'my boy',	'My boy\n\nYou help me so much\nEven though youre so young\nYou carry a burden not meant to be sung\n\nI admire you son\nI see your gentle heart\nYouve shown me the light when Ive been stuck in the dark\n\nI no longer see a boy\nI see a king, I see a man\nI stand here overwhelmed as I try to understand',	'',	'public'),
(1013,	893,	6,	6,	NULL,	'image',	'https://image.freepik.com/free-vector/abstract-technology-particle-background_52683-25766.jpg',	'nullus onym',	'i wonder',	'I wonder\n\nI wonder where they go, those precious precious souls\n\nWhen life at last is lost\nUpon our precious shores\n\nWhen old and young and lively\nDescend  down deathly drawers \n\nI wonder if theres nothing or life evermore\n\nI wonder what of love and promises to keep\n\nIf really theres a God who separates the sheep\n\nI wonder if were weighed upon the weary scale\n\nIf balance being unblameable\nwill someday actually fail\n\nI wonder if its true\nThose precious precious few\n\nWho carry with them precious \npieces as they say adieu \n\nPrecious little parts of peoples precious hearts\n\nI wonder if it eases into enigmatic art\n\nI wonder were they go\nThose precious precious souls\n\nI hope they go to heaven with glory gained and gold\n\nI hope that life continues \nBeings begging to behold\n\nI wonder if theres fullness\nFor young and very old\n\nI wonder all these things\nAll these things that Ive been told\n\nI ponder all these things\nI wonder, with wondrous woes \n\nI wonder where they go\nThose precious precious souls\n',	'',	'public'),
(1014,	894,	1,	6,	NULL,	'color',	'#FF00FF',	'caleb',	'The Richest',	'The richest\n\nThere is an ancient proverb found in a hidden place,\nvoiced in the Hebrew tongue.\n\nThe creator chose the poor to be rich in their faith, but the rich come undone\n\nAnticipation seems to be the seat of pleasure for all human desire. \nYet as we attain our goals\nMore needs to be consumed by that fire\n\nWhen satisfaction comes to all our basic needs\nThe desire for something more unquenchably supersedes\n\nWe forget the joy of suffering, and the peace of longing hope,\nWe set our eyes towards greed\nOr fit our neck to a rope\n',	'',	'public'),
(1015,	895,	3,	6,	NULL,	'image',	'https://cdn141.picsart.com/366574783002201.jpg?type=webp&to=min&r=640',	'me',	'tell me',	'Tell me brother \n\nTell me brother why do you have hate in your eyes\n\nJust because I believe something you claim to despise\n\nTell me brother How the hell are we suppose to harmonize \n\nWhen were a tribal nation on the cusp of demise',	'',	'public'),
(1016,	896,	1,	6,	NULL,	'color',	'#F08080',	'Owl',	'soul',	'\nIn the depths of the soul\nConsummation of void and spark \nBegins a gentle journey of lasting will and heart\n\npeer thou past the abyss of nothings ignorant bliss\nVacant the soul is born\nLonging past the dark\n\nFill thoust empty vessel\nYoung and empty soul\nFire to quench your thirst\nTo belong, to be made whole.',	'',	'public'),
