(1021,	901,	5,	6,	NULL,	'color',	'#191970',	'nullus',	'the valley of my heavy heavy soul',	'The valley of my heavy soul \n\nIt was 2 oclock before I left my bed\nA sharp pointed pain inside my head\nThe sun was out so bright with glee\nYet my soul had begged for me to flee\nPurpose so dry like the dirt outside\nWhat direction should I see within my life\nIntrospective reflection has lost its pride\nIn the valley of my heavy soul\n\n Boldness spent upon the dust\nThe winds bellowing constant a must\nTime would drag me forward with it\nNo effort Id make to heed the spirit\nDismal long and great the void\nFuel that never engaged the toil\nHard to fight the pointless trek\nWhen meaninglessness has no tangible respect\n\nFree my chains to vapour and mist\nGrant me purpose so life is not missed\nPeace and joy a frail construction\nThe mind procures everlasting destruction \nChange the path of colourless spree \nFill my heart with unbridled glee\nI wish to have a destiny \nBeyond the valley of my heavy soul',	'',	'public'),
(1022,	902,	3,	6,	NULL,	'image',	'https://venngage-wordpress.s3.amazonaws.com/uploads/2018/09/Colorful-Geometric-Simple-Background-Image.jpg',	'dad',	'if not for you',	'If not for you \n\nIf not for you I would have no part\nIn this odd pocket of time some suggest is an art\nIf not for you, Id have no breath\nTo breathe out words of lasting effect\nIf not for you I would have never known\nThe secure embrace fathers give to their home\nIf not for you I would not understand\nHow to feel like a boy but grow to a man\nIf not for you I dont think I would be\nAs joyful as I am, my soul not so free\nEven with all  your failures and flaws\nIf not for those, I wouldnt know righteous laws\nThough human decree will always create loss\nThe love where it came from\ntrumps the devils claws\nIf not for you being all that you are\nI would not be me, Id be distant like the stars\nIf not for you Id be less then ok\nSo thanks and I love you, and happy Fathers Day.',	'',	'public'),
(1023,	903,	5,	6,	NULL,	'image',	'https://venngage-wordpress.s3.amazonaws.com/uploads/2018/09/Colorful-Geometric-Simple-Background-Image.jpg',	'caleb',	'the day i was told of you',	'The day I was told of you\n\nI still remember the exact moment I was told of you\nThe terror that took me was sudden for I was still a child\nAn unexpected exigency now pierced me through\nAnd my careless freedom all but defiled\n\nHow can one so young be given so much\nHow can an inward mind be stretched to others touch\nOh my, I still remember that powerful rush\nThe day I was told of you\n\nChoosing to ignore the reality before me\nI pretentiously assumed the role of a greater man\nno concept of this new responsibility\nI chose to live in a land of pretend\n\nHow can one be so dim of wit\nHow could I be so full of it\nIt would soon be revealed that I  knew shit\nThe day I was told of you\n\nLike a bolt of lightning that splits the night\nCharged electric enigmatic surprise\nNo time for reason worry or delight\nI again had no sense of were the truth lied\n\nHow can a child grow to a man\nHow can a boy make callous hands\nWas this moment from divine plans?\nThe day I was told of you\n\nExplosive as the moment the light strikes the earth\nWondrous as the surface of the flaming suns flare\nA crown of life given at this new birth\nCaptivated I was at that innocent stare \n\nHow can a dad take hold of his babe\nHow could he not know the years of joy he would create\nThe terror would go and life forever changed\nThe day I took hold of you\n',	'',	'public'),
(1024,	904,	4,	6,	NULL,	'color',	'#87CEFA',	'onym',	'my bipolar moon',	'my bipolar moon\n\nHow bright how stunning how drab how dark\n\nHow is it that you have stolen my heart?\n\nPerhaps its because we share the same fate\n\nHalf of you being light to inspire to elate\n\nOh my heart leaps when you illuminate the earth\n\nMy thoughts race and dance and new joys begin to birth\n\nBut like me you too will soon fade into black\n\ndespair soon sinks in as earth turns her blue back\n\nDelight that has been will be swallowed up whole\n\nNothing to be glad for nothing new to be told\n\nBut oh how love grips me as I stare at you moon\n\nMy hope returns triumphant \n\nMy mind freed from its tomb\n\nI recognize despair has blanketed our soul\n\nBut short lived it shall be\n\nForever victors of this cold',	'',	'public'),
(1025,	905,	1,	6,	NULL,	'image',	'https://image.freepik.com/free-vector/abstract-technology-particle-background_52683-25766.jpg',	'onym',	'distant star',	'Distant star\n\nStrange you are\nThe colours you show\nFlicker from far\nElaborate light cloths\n\nWhat is your type\nIts hard to say\nYour changes, my fright\nBy night, by day\n\nBrilliant and varied\nYour pulsing heart is\nWaves of thought tarried\nTo label amiss \n\nDance through the prisms colours\nDont choose one to be safe\nBright star of valour \nBe many, be brave\n\nBlue yellow red green\nNone of these but all\nPurple white orange seen\nBe proud, stand tall\n\nStrange you are\nThe colours of you\nAdventure calls\nIll enjoy my view',	'',	'public'),
(1026,	906,	3,	6,	NULL,	'color',	'#C0C0C0',	'dad',	'normalcy',	'Normalcy\n\nThe luxury of normalcy eludes me\nThis conspiracy that we can all be free of inconsistency ...\n...It\\\'s just not true\nI grasp at the lack of an ability\nto see that normal  is a commodity that\\\'s no longer available to me\n\nNormalcy eludes me\n\nI wish to feel this situation return to normality\nBut it\\\'s ludicrously ripping me from my lucidity\nMy mind is up and down, I\\\'m a blood hound sniffing around, listing for the sound  of normalcy\n\nDamn what a fallacy the way we think we can walk around normally when everything I choose to be is as foreign as other galaxies \n\nGoing against reality I find a plurality of possibilities that set me free but again none are for me.\n\nNormalcy eludes me\n\nWhat was the baseline for my plea\nWhat would I consider to be\nA normal reality that could bless my broken home or offer me even a bree of normalcy\n\n\nIs normal accepting insanity? is it giving up on my candidacy for a place in history. Is it beating my drum furiously or lifting my hands strenuously plowing the ground before me opening the way to purge my apathy and embrace an empathy once more in the light of a kingly authority from a Diety who claims to love me, says he is the reason to be, puts his robe and his ring on me.\n\nIs normal accepting the baseline is not me is it laying my crown at the feet of the king of kings. Is it sharing in the doxology is it abandoning all heresy is it  begging for mercy is it embracing uncertainty or is the luxury of normalcy a lie from an enemy?\n\nMaybe it\\\'s ok\nIf normalcy eludes me\n',	'',	'public'),
(1027,	907,	6,	6,	NULL,	'color',	'#FF00FF',	'woner',	'the dunce and the rose',	'The dunce and the rose\n\nMy dear\nMany times Ive found myself on the cusp of expression,\nEach effort however has left me cringing with fear or trembling with a crippling notion of inefficacy.\nI wish to describe what cannot be articulated\nAnd to give proper respect to the most valuable treasure I have been blessed to share, which is you my dear\n\nSo in this valiant attempt to overcome my apprehension and timidity I have personified you my dear into the delicate embodiment of a rose\n\nThe beauty of a rose is obvious, there is no hiding the carefully crafted splendour of the ornate design\nThe fragrance of the rose comforting and delighting, \n\nBut what is not apparent is the fragile nature of interacting with such a magnificent work of art\n\nYou see my dear\nIf one carelessly assumes he can handle the rose without consideration he will be received with the sharpness of its defensive nature\n\nThe rose is not wicked for simply being who she is, it is the poor dunce who sees the beauty and assumes he can grab it for himself\n\nThe simpleton attempts again to tame the wild rose and again is pointedly prevented\n\nSo the brash fool decides to use a tool and cut the rose from her place of lushness \n\nHe then traps the rose in a stagnant vat and displays her like a prize\nWithout question or effort he allows whom ever pleases to press their unwanted visage up against her now wilting peddles\n\nIn a fortnight she is dry and the life and beauty that once was has drifted to the apathetic oblivion\n\nSeeing how his prize is all but spent the ignorant utilitarian misjudges his flower for being of lesser grade then he otherwise first ascribed to her\n\nHe makes quick work of disposing what once was so precious and pleasant and begins to look again\n\nOh wretched fool!\nOh wicked man!\n\nLet me teach you about the rose\n\nShe is of finest quality\nRare are her traits not many can trump her ability to satisfy the senses\n\nIt is a dunces logic to assume the collapsing integrity of the rose is of her own making\n\nShe must never be handled with clumsy intent but be carefully considered,\nLeft to grow in her own way the rose thrives, \nIf one wishes to elevate her and continue to bask in her exquisite aroma, he must take great care to place trained hands meticulously between her defences\nonly then can you truly add to the life of the rose\n\nYou must assist in removing what has no more use, the pruning of an artist is complementary to the lavish rose\n\nYou may never trap a rose or remove her from her roots, for she will always die,\n\nStrong and independent she freely gives her defence to lesser creatures, she is a staple in the garden, a delight to all who see her\n\nSo I warn you Mr dunce, Learn before you take\nCoexist with an energetic synergy \nGive once you are trained to do so, and respect the beautiful beautiful rose.....my dear',	'',	'public'),
(1028,	908,	5,	6,	NULL,	'image',	'https://cdn141.picsart.com/366574783002201.jpg?type=webp&to=min&r=640',	'caleb',	'the rock',	'The rock\nSubmission not a choice the rock has observed\ninevitable the change for it is made of stone clay and dirt\nPowerless to adapt amongst the dust of the stars\nReckless the assumption, master over its parts\nThe cornerstone at birth considers its template pure\nUseless it becomes unless something comes to cure\ndisfigurement brought on by the careful change of time\nNow different from the original the fit is quite sublime',	'',	'public'),
(1029,	910,	6,	6,	NULL,	'color',	'#006400',	'caleb',	'I am Tree',	'I am tree\n\nI split open at the first touch of warmth\nThe frost below me subsided\nearth became a cozy hearth\nDead shell around me denuded\nMy soul aches for the light and the bright\nI reach towards the heavens with crass determination \nheavenward I battle with all my might\nMy resolve runs dry and saps motivation\n\nSomething refreshing washes my core\nThis fine infiltration, life giving, I want more\nI return to my instinct to rise once again\nThrough the dark I push and upward I ascend\n\n\nFinally the black who held me tight splits\nA rush fills my veins, strength caresses through wisps \nOblivious I was to the prison of my birth\nTo return to that dark would be a grave curse\n\n \nDay after day I am greeted by pleasantries\nWhen the land is parched the clouds pour abundantly, \nThe sun has become my wonderful ally\nHe greets me each morning with brilliant sunrise\nI open my leaves and he electrifies my cells \nMy carbon based body thickens and swells\nI am never cold or alone in this place, \nquintessential peace that greets with such grace\n\n\nWhat is this discomfort? Im starting to fry\nThe ally who cared is suddenly too dry\nMy face turns downward. My soul again sapped\npulchritudinous leaves have cracked and now chapped\nI struggle to continue my course to the sky \nIm left with a choice I cannot deny\nContinue to grow to live and adapt.\nOr stay as I am, shrivel up and collapse \n\nI push my roots deeper, oh what sweet relief\nThe moist treasure below has given peace to this tree\nI once again grow and continue my call\nTo reach ever upward, to learn to stand tall\n\nWait whats going on? My heart began to pound\nThat deathly cold creature was flirting with the ground\nI left you to die in the place of my birth\nYou cannot return, you chase winters dearth\nTerror consumed me as I watched my brothers fall\nSummers  warm wisps morphed to torrential claws\nI will not give up the life that Ive made! I will not yield, to no one I am slave!\n\nEffort was valiant I fought longer then most \nI battled the wind like one fighting a ghost\nBut the cold had her way, she cut and she slashed\nShe pushed through the ground and froze where I basked\nGasping I broke, my will all but crushed\n I submitted to death as up against me she brushed\n\n\nAbundance had vacated My once familiar home\neerie empty consumed what had flourished and grown\nLike a calming quilt that rests on a bed\nThe white blanket was cast upon my stripped head\nMy soul seemed lost while I waited in this freeze\nNo ability to grow no satisfaction for my needs\nMy purpose a blur distant gone in the breeze\nI am fully dead no gasp of painful pleas\n\nThe long dark continued age after age\nId never felt a season so quiet with rage\nMy life story ends right here in this place \nthe warmth of my friend will never grace my bleak face\n\nWait, what is this? Desolation begins to break\nHas that cold consuming demons hunger finally been slaked?\nYes, yes yes yes I felt her again,\nThe gentle warmth of springtime my sensational old friend!\nMy life will see newness again and again\nI will honor this time and fight to ascend\n\nI am not the master over this life that I live,\nso I will grow when I can and I will die when it fits\nFor all of the pain that winter may cause\nSpring will return and reclaim what was lost\nI am free to be what I am made to be\nSo I will be what I am because I am Tree',	'',	'public'),
(1030,	911,	5,	6,	NULL,	'image',	'https://venngage-wordpress.s3.amazonaws.com/uploads/2018/09/Colorful-Geometric-Simple-Background-Image.jpg',	'Caleb 2',	'fire head',	'<p>Fire head, loud and red\n</p><p>Quick to flail about </p><p>Control you must this awful dread</p><p>And learn to flee the pout</p><p>Great and strong you carry along</p><p> resolve no man can break</p><p>Cheer and joy your fiery song</p><p> passion no thing can slake</p><p> \nFire heart, flash and spark</p><p>Emotions soaring high</p><p>Jump and laugh and play till dark</p><p>Forever feeling spry</p><p>Oh the crash glee gone in a flash\ngratification sees the end</p><p>You forget fire head that youve made such a splash\n tomorrow welcomes you as friend</p><p>Fire boy rest from noise</p><p>That keeps you curious\n</p><p>Close your eyes for dreams surprise</p><p>and remove all fear from us\n</p>',	'',	'public'),
