(14507,	'_transient_attachment_text100',	'a:2:{s:4:\"text\";s:3500:\"# About the query on same day starting and ending contest:\r\nWe are just validating the dates as of now. we are not validating time. So, if you add the same date as starting date and ending date, it will not work.\r\nBut we can add time if you want it that way.\r\n\r\n\r\n\r\n# About the video you sent-\r\nContest 1:\r\nFirstly, You created the contest on 20th November. Second of all, you put the starting date on 18th November 2021 and the ending date 19th November 2021 whereas to Enter the game, you need the registration to be open. When you put a past date as an ending date, that means your registration is closed.\r\nSolution- You should have put your ending date as 20th November 2021 to enter the game.\r\n\r\nContest 2:\r\nIssue 1: Nan day Nan minutes might be a glitch. I\'m not getting Nan. None of us could replicate the issue.\r\n\r\nIssue 2: Minimum requirement is 12 users for a functional tourney. After you were done entering the users to the contest, you should have changed the ending date from admin(From 20th November 2021 to 19th November 2021) so that the registration could be closed. You can\'t play the game if the registration is open. After that you needed to select winners from edit as per the total winners numbers you put while creating the contest. You had to save the edits afterwards. Then, you needed to run the CRONJOB to play round 1. After playing round 1, you needed to run the cronjob again to play Final. After playing final, you needed to run the CRONJOB for the last time to \"SEE THE WINNERS\".\r\n\r\n\r\n\r\nTo run the whole process you need to follow some steps:\r\n\r\n# STEPS TO FOLLOW:\r\n1. Create Contest with starting date as a PAST date and ending date as a PRESENT/FUTURE date.\r\n\r\nLoom link- https://www.loom.com/share/dc31b30a2be24fa987f120e228300f99\r\n\r\n2. Enter atleast 12 users into the tournament on user>tourneys>scheduled tournament.\r\n\r\nLoom link- https://www.loom.com/share/dbd5e2256978444f87c56aa8fb12f582\r\n\r\n\r\n3. After entering atleast 12 users to the tournament, you have to go back to admin>game settings>list portfolio>Edit and change the ending date of tournament from PRESENT/Future date to a PAST date.\r\nFor example- I added a tournament with a starting date of 19th November 2021 and ending date of 23rd November 2021. After entering the users to the tournament, I have to go back to admin and change the ending date from 23rd November to 21st November to make it work. Select atleast 2 winners in edit contest if your Total Numbers of Winners is 2. Select 3 winners in edit if your Total Number of Winners is 3.\r\n[Note: Starting date should be long back previous date so that ending date doesn\'t clash with starting date. Ending date can\'t be a date before starting date]\r\n\r\nLoom link- https://www.loom.com/share/33c028197f164aeba6a8a77e387d765c\r\n\r\n\r\n4. After you\'re done with changing the ending date, you have to run CRONJOB to play the first round of the game.\r\n\r\nLoom link- https://www.loom.com/share/edf56528ddad433ea96b05b7797d7736\r\n\r\n\r\n5. After playing round 1 with the users, run CRONJOB again to play Final.\r\n\r\nLoom link- https://www.loom.com/share/881b0bab07a846618ee79484dc10a4f6\r\n\r\n6. After playing Final with less than 12 users, run CRONJOB again to \"SEE THE WINNERS\".\r\n\r\nLoom link 1- https://www.loom.com/share/1c3da76e1d1b40399bda24668b2c40b5\r\nLoom link 2- https://www.loom.com/share/7eed442007f644b0bfc192f2ed9c10ed\r\n\r\n[Note: Everytime after you run the CRONJOB, close the CRONJOB tab]\r\n[Note: You need to run CRONJOB 3times during the whole process]\r\n\";s:9:\"more_text\";b:0;}',	'yes'),
