(18044,	'_transient_attachment_text123',	'a:2:{s:4:\"text\";s:5411:\"*********8- it seems like the whole notification system is lacking) in the original notes, it was suppose to send an email AND a notification to the users \r\nbuddy boss account. I only get a few emails. mainly the ones for moving on, or being removed. All of these need to be edited and some need to be added, Ive made \r\neach notification a separate point*********** \r\n\r\n*********9- the first tourney notification is missing. Once a tourneys registration closes it opens up the first voting round. A notification needs to be \r\nsent to all participants immediately once the registration closes and the voting phase is opened. Registration will close at 11:59pm on whatever date it is set \r\nfor so the notification needs to be sent out at 12AM the next minute and following day\r\nThis notification needs to read as follows\r\nThe (Name of contest) contest you joined is now live!\r\nYou have until 11:59pm tonight to complete the 1st round of voting.\r\nIf you fail to complete the voting round you will be eliminated from the contest.\r\nPlease click here<(this needs to link to the first round of voting) to continue\r\nAlternatively you can log into your account, navigate to my tourneys under the tourneys tab and select the play now portion of the ticket to participate \r\nin round 1. \r\nGood luck!**************** \r\n\r\n\r\n*********10- four hrs before the close of EVERY phase, notifications need to be sent to all participants who havent voted.\r\nThe wording is the same for all legs except the last leg of the tourney.\r\nNotification needs to read as follows\r\n(Users name), time is almost up! You have until 11:59 PM. Please >click here <(make this link to take them to current phase of tourney) to complete the\r\n voting process for this round of the tourney.\r\nIf you fail to complete the voting process you will be disqualified.\r\nGood luck and please vote honestly*********** \r\n\r\n\r\n**********11-When a person is disqualified for not voting a notification needs to be sent to them reading as follows\r\nYou have been disqualified for not completing the voting phase. \r\nIn order to proceed through tournaments you must vote during each leg of the tourney.*********** \r\n\r\n\r\n\r\n**********12-when a person has been knocked out from not winning the vote the notification needs to read as follows\r\nThank you so much for participating in our tourney.\r\nWe are sorry to say you have been knocked out.\r\nAll art is beautiful, unfortunately yours didnt get picked today. Keep on going and keep trying there will be many more opportunities to shine!\r\nWe will see you in the next one!*************** \r\n\r\n\r\n**********13-When a person advances the notification needs to be sent out at 12AM one minute after the last round closed. the notification needs to read as follows\r\nCongratulations (user name), you are moving on to the next round.\r\nPlease click here<(this link should take you to the next round of voting) to continue to the voting phase of the next round and good luck!\r\nRemember failing to complete the voting process before 11:59 PM will result in elimination.**********\r\n\r\n\r\n**********14-When a person advances to the final round of the tournament the notification needs to read as follows\r\nCongratulations, (user name) you have risen to the top. Your expression has struck a chord amongst your peers.\r\nThis is the final stage of the tournament. It may be hard to vote for another work at this point but please continue to vote honestly.\r\nGood luck and we will see you at the finish line.************* \r\n\r\n\r\n**********15- When the final phase of the tournament begins 12AM on the final day, a notification needs to be sent out to all participants who have been knocked out \r\nalready in earlier phases. The notification reads as follows\r\n(User name) thank you for participating in (name of contest) you still have a chance to be a winner,\r\nPlease click here <(link to the voting phase of the final round) to proceed to the final voting phase.\r\nIf you complete this final round of voting you are entered into a random draw to receive one of the best prizes of the tournament.\r\nIf you choose not to participate you will not be entered into the draw.\r\nGood luck and we will see you next time!************ \r\n\r\n\r\n**********16-when the tournament is over at 11:59PM a notification needs to be sent to the winners at 12AM one minute later and the next day.\r\nThe notification needs to read as follows\r\n-For the winner\r\nCongratulations (user name) on winning the tournament.\r\nYou shone the brightest today!\r\nYou are a very talented artist and we look forward to seeing more from you in the future.\r\nIf you have won a prize, someone from Universe.Art will email you requesting more information.\r\nCongratulations again and we will see you at the next one!\r\nFor 2nd through 11th if applicable\r\nCongratulations (user name) on placing (tournament finish position) in the tournament.\r\nYou were among the stars today\r\nYou are a very talented artist and we look forward to seeing more from you in the future.\r\nIf this position qualifies for a prize someone from Universe.Art will email you requesting more information.\r\nCongratulations again and we will see you at the next one!\r\nFor the random draw prize winner-\r\nCongratulations (user name),\r\nThanks to your vote you have won the random draw.\r\nSomeone from Universe.Art will email you requesting more information.************\";s:9:\"more_text\";b:0;}',	'yes'),
(18045,	'_transient_attachment_text124',	'a:2:{s:4:\"text\";s:10003:\"^^^^^^^^^^^^1-When writing a description for a tourney, in the popup the text continues to scroll to the right instead of creating new lines of text underneath. \r\nThis needs to be changed so that it scrolls down if necessary but not off to the right^^^^^^^^^^^^\r\n\r\n\r\n************2- Ive noticed that the basic description for the pop up is the same as the ticket. This was suppose to be 2 separate text options.\r\n As you can see one will require a lengthier description and one should have a character cap that limits the text from continuing off the page\r\nIve also noticed on mobile the text just continues off screen on the tourney ticket. This leaves us with barely 25 characters.\r\nSome of the descriptions will require more characters then this.\r\nThe text needs to stack downwards on mobile as well************* (confirm from shayan)\r\n\r\n\r\n************3- found a bug. The enter portal screen closes unexpectedly quite often. when I use the side scroll it seems to close unexpectantly. \r\nTechnically if the text didnt continue off screen to the right there would be no side scrolling, maybe that would fix the bug completely*********** (confirm from shayan)\r\n\r\n\r\n************4-there is no preview option to view your work before submitting it, when submitting a new work to a tourney.\r\nThey should be able to preview it before submitting-also when choosing a background color there was suppose to be an option for selecting if your font was dark\r\n or light. I couldnt find this feature anywhere************ (confirm from shayan)\r\n\r\n\r\n^^^^^^^^^^5- when a mandatory field is not filled out during the contest sign up and you click submit new, nothing will happen. This is confusing since there is\r\n no prompt telling them that fields are missing and since most of the fields are scrolled off screen there would never be an indication that additional info is \r\nneeded it just seems like you press the button and nothing happens. We need some kind of error message to display here telling the user to finish filling out the form.\r\n Perhaps something like\r\nOne or more mandatory fields are missing^^^^^^^^^^^^^\r\n\r\n\r\n**********6- when I set a new tourney for a previous date and todays date. It says tournament registration closed. This should still allow participants to\r\n sign up until 11:59pm like all the other options. (This one may have been fixed)*********** (confirm from shayan)\r\n \r\n\r\n*********7- when joining a contest and submitting a work if someone accidentally chooses submit new instead of selecting a work there is no back button \r\nto take them back to their selection currently the only work-around, is to close everything and restart the entire entry process.\r\nThis is very impractical as it is very easy to accidentally select the wrong button)********** (confirm from shayan)\r\n\r\n\r\n*********8- (it seems like the whole notification system is lacking) in the original notes, it was suppose to send an email AND a notification to the users \r\nbuddy boss account. I only get a few emails. mainly the ones for moving on, or being removed. All of these need to be edited and some need to be added, Ive made \r\neach notification a separate point*********** (confirm from shayan)\r\n\r\n\r\n*********9- the first tourney notification is missing. Once a tourneys registration closes it opens up the first voting round. A notification needs to be \r\nsent to all participants immediately once the registration closes and the voting phase is opened. Registration will close at 11:59pm on whatever date it is set \r\nfor so the notification needs to be sent out at 12AM the next minute and following day\r\nThis notification needs to read as follows\r\nThe (Name of contest) contest you joined is now live!\r\nYou have until 11:59pm tonight to complete the 1st round of voting.\r\nIf you fail to complete the voting round you will be eliminated from the contest.\r\nPlease click here<(this needs to link to the first round of voting) to continue\r\nAlternatively you can log into your account, navigate to my tourneys under the tourneys tab and select the play now portion of the ticket to participate \r\nin round 1. \r\nGood luck!**************** (confirm from shayan)\r\n\r\n\r\n*********10- four hrs before the close of EVERY phase, notifications need to be sent to all participants who havent voted.\r\nThe wording is the same for all legs except the last leg of the tourney.\r\nNotification needs to read as follows\r\n(Users name), time is almost up! You have until 11:59 PM. Please >click here <(make this link to take them to current phase of tourney) to complete the\r\n voting process for this round of the tourney.\r\nIf you fail to complete the voting process you will be disqualified.\r\nGood luck and please vote honestly*********** (confirm from shayan)\r\n\r\n\r\n**********11-When a person is disqualified for not voting a notification needs to be sent to them reading as follows\r\nYou have been disqualified for not completing the voting phase. \r\nIn order to proceed through tournaments you must vote during each leg of the tourney.*********** (confirm from shayan)\r\n\r\n\r\n**********12-when a person has been knocked out from not winning the vote the notification needs to read as follows\r\nThank you so much for participating in our tourney.\r\nWe are sorry to say you have been knocked out.\r\nAll art is beautiful, unfortunately yours didnt get picked today. Keep on going and keep trying there will be many more opportunities to shine!\r\nWe will see you in the next one!*************** (confirm from shayan)\r\n\r\n\r\n**********13-When a person advances the notification needs to be sent out at 12AM one minute after the last round closed. the notification needs to read as follows\r\nCongratulations (user name), you are moving on to the next round.\r\nPlease click here<(this link should take you to the next round of voting) to continue to the voting phase of the next round and good luck!\r\nRemember failing to complete the voting process before 11:59 PM will result in elimination.********** (confirm from shayan)\r\n\r\n\r\n**********14-When a person advances to the final round of the tournament the notification needs to read as follows\r\nCongratulations, (user name) you have risen to the top. Your expression has struck a chord amongst your peers.\r\nThis is the final stage of the tournament. It may be hard to vote for another work at this point but please continue to vote honestly.\r\nGood luck and we will see you at the finish line.************* (confirm from shayan)\r\n\r\n\r\n**********15- When the final phase of the tournament begins 12AM on the final day, a notification needs to be sent out to all participants who have been knocked out \r\nalready in earlier phases. The notification reads as follows\r\n(User name) thank you for participating in (name of contest) you still have a chance to be a winner,\r\nPlease click here <(link to the voting phase of the final round) to proceed to the final voting phase.\r\nIf you complete this final round of voting you are entered into a random draw to receive one of the best prizes of the tournament.\r\nIf you choose not to participate you will not be entered into the draw.\r\nGood luck and we will see you next time!************ (confirm from shayan)\r\n\r\n\r\n**********16-when the tournament is over at 11:59PM a notification needs to be sent to the winners at 12AM one minute later and the next day.\r\nThe notification needs to read as follows\r\n-For the winner\r\nCongratulations (user name) on winning the tournament.\r\nYou shone the brightest today!\r\nYou are a very talented artist and we look forward to seeing more from you in the future.\r\nIf you have won a prize, someone from Universe.Art will email you requesting more information.\r\nCongratulations again and we will see you at the next one!\r\nFor 2nd through 11th if applicable\r\nCongratulations (user name) on placing (tournament finish position) in the tournament.\r\nYou were among the stars today\r\nYou are a very talented artist and we look forward to seeing more from you in the future.\r\nIf this position qualifies for a prize someone from Universe.Art will email you requesting more information.\r\nCongratulations again and we will see you at the next one!\r\nFor the random draw prize winner-\r\nCongratulations (user name),\r\nThanks to your vote you have won the random draw.\r\nSomeone from Universe.Art will email you requesting more information.************ (confirm from shayan)\r\n\r\n\r\n*********17- tournaments that are past the registration close need to auto delete in the scheduled tournaments tab, otherwise they stay forever or an admin has to\r\n manual delete them every time, this isnt a viable option.************ (confirm from shayan)\r\n\r\n\r\n*********18- users need to be able to manually delete tournaments on their own time, in the My Tournaments tab. Otherwise they pile up pretty quick and it becomes\r\n confusing*********** (confirm from shayan)\r\n\r\n\r\n^^^^^^^^^19- I am still getting the NaN days etc error on the tournament tickets, not sure why this is on every tournament I make (see picture)\r\nResolved^^^^^^^^^^^^\r\n\r\n\r\n*********20-i notice in order to get the cronjob to work I need to select winners at the beginning? This is very confusing, is it just a requirement to get \r\nthe cronjob to work? What needs to happen in the real world is the software needs\r\nto select the winners based on who actually wins via the most votes.*********** (confirm from shayan)\r\n\r\n\r\n\r\n*********21-in the admin section, when trying to delete multiples of anything using the bulk action option then delete, it never works. Ive tried it in list portfolio\r\n and list contest, I can delete things one at a time but not in bulk.*********** ((only images can be deleted in bulk action(confirm from shayan)))\r\n\r\n\r\n*********22- is there a way to make the admin list sections more legible? And also to search for individual things. There is already hundreds of entries for portfolio\r\n works and trying to locate a specific one using the admin is impossible without a ...\";s:9:\"more_text\";b:1;}',	'yes'),
