(185,	91,	'document_preview_mirror_text',	'# About the query on same day starting and ending contest:\r\nWe are just validating the dates as of now. we are not validating time. So, if you add the same date as starting date and ending date, it will not work.\r\nBut we can add time if you want it that way.\r\n\r\n\r\n\r\n# About the video you sent-\r\nContest 1:\r\nFirstly, You created the contest on 20th November. Second of all, you put the starting date on 18th November 2021 and the ending date 19th November 2021 whereas to Enter the game, you need the registration to be open. When you put a past date as an ending date, that means your registration is closed.\r\nSolution- You should have put your ending date as 20th November 2021 to enter the game.\r\n\r\nContest 2:\r\nIssue 1: Nan day Nan minutes might be a glitch. I\'m not getting Nan. None of us could replicate the issue.\r\n\r\nIssue 2: Minimum requirement is 12 users for a functional tourney. After you were done entering the users to the contest, you should have changed the ending date from admin(From...'),
