(328,	123,	'document_preview_mirror_text',	'*********8- it seems like the whole notification system is lacking) in the original notes, it was suppose to send an email AND a notification to the users \r\nbuddy boss account. I only get a few emails. mainly the ones for moving on, or being removed. All of these need to be edited and some need to be added, Ive made \r\neach notification a separate point*********** \r\n\r\n*********9- the first tourney notification is missing. Once a tourneys registration closes it opens up the first voting round. A notification needs to be \r\nsent to all participants immediately once the registration closes and the voting phase is opened. Registration will close at 11:59pm on whatever date it is set \r\nfor so the notification needs to be sent out at 12AM the next minute and following day\r\nThis notification needs to read as follows\r\nThe (Name of contest) contest you joined is now live!\r\nYou have until 11:59pm tonight to complete the 1st round of voting.\r\nIf you fail to complete the voting round you will ...'),
(329,	123,	'document_preview_generated',	'yes'),
